import {Home} from './pages/Home'

function App() {
  return (
    <Router>
      <Switch>
        <Route exact path="/" component={Home}/>
        <Route exact path="/user" component={UserProfile}/>
        <Route exact path="/about" component={About}/>
      </Switch>
    </Router>
  );
}

export default App;
